import React from "react";
import ReactDOM from "react-dom";
import {IoIosPerson} from "react-icons/io";
import {AiFillMail} from "react-icons/ai";
import {RiLockPasswordFill} from "react-icons/ri";

function RegistrationPage() {
    return (
        <div>
            <form>
                <center>
                    <div className="mb-3 mt-5">
                        <h2 className="jumbotron">Sign Up</h2>
                        <table>
                            <tr><td><IoIosPerson></IoIosPerson></td><td><input type="name" className="form-control" id="floatingInput" placeholder="Name" /></td></tr>
                            <tr><td><AiFillMail></AiFillMail></td><td><input type="surname" className="form-control" id="floatingInput" placeholder="Email" /></td></tr>
                            <tr><td><RiLockPasswordFill></RiLockPasswordFill></td><td><input type="password" className="form-control" id="floatingInput" placeholder="Password" /></td></tr>
                            <tr><td><RiLockPasswordFill></RiLockPasswordFill></td><td><input type="confirmPassword" className="form-control" id="floatingInput" placeholder="Confirm Password" /></td></tr>
                        </table>
                    </div>
                </center>
            </form>
        </div>
    );
}

export default RegistrationPage;
